import React from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { filterPlanetsName } from '../actions/filterPlanetsName';

class FiltroNumerico extends React.Component {
  render() {
    return (
      <div>
        <select name="select" data-testid='column-filter'>
          <option value="population">population</option>
          <option value="orbital_period" selected>orbital_period</option>
          <option value="diameter">diameter</option>
        </select>
      </div>
    );
  }
}

export default FiltroNumerico;
